package forlooping;

public class Printnumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int end=20;
		
         for(int c=2;c<=end;c++) // (intialization;condition;iteration)
         {
        	 System.out.println(""+c);
        	
         }
	}

}         // odd number (c=1;c<=end;c+=2)   //even number (c=0;c<=end;c+=2)
